This immediately breaks the GetCurrentVersionEnvironment, because our null check no longer makes sense. Instead of checking for null and returning early, we can use Select on the Option to project its value. public Option<VersionEnvironment> GetCurrentVersionEnvironment(PackageName packageName)
{ return ReadCurrentVersion(packageName) .Select(currentVersion => { var versionPath = GetVersionPath(packageName, currentVersion); return new VersionEnvironment(currentVersion, versionPath); });
}

