This is already much simpler, since we've got rid of that explicit null check. There's still room for simplification, since our projection takes up two lines and we ideally only want a single expression in our projection. We can achieve this by translating our expression to query syntax: public Option<VersionEnvironment> GetCurrentVersionEnvironment(PackageName packageName)
{ return from currentVersion in ReadCurrentVersion(packageName) let versionPath = GetVersionPath(packageName, currentVersion) select new VersionEnvironment(currentVersion, versionPath);
}

