If you declare int? integer = 1337; You can access the Value directly via i.Value. The typical beginner question on the monad is therefore how to get to the value in a monad. The Option-Monad intentionally has no way to get to the value directly because that would an unsafe operation. The whole point of an optional is that it sometimes has no value. Instead you should inject the behaviour into the monad. The basic Example: int? integer = MaybeValue(); if (integer.HasValue())
{ Console.WriteLine($"Value: {integer.Value}");
} Injecting the behaviour: Option<int> integer = MaybeValue(); integer .AndThen(i => Console.WriteLine($"Value: {i}")); Or in Linq syntax: from integer in MaybeValue()
select Console.WriteLine($"Value: {integer .Value}");
